function toggleMenu() {
    let navigation = document.querySelector('.navigation');
    let toggle = document.querySelector('.toggle')
    navigation.classList.toggle('active');
    toggle.classList.toggle('active');
}

window.onload = function () {
    console.log("loaded")
    var typed = new Typed('#typed', {
      strings: ["Welcome to Faculty", "Learn Commerce", "Computer Application in Business", "Accounting", "Marketing", "Taxation", "Economics", "and other awesome Learning Experiences with us :)"],
      backSpeed: 15,
      smartBackspace: true,
      backDelay: 1200,
      startDelay: 1000,
      typeSpeed: 25,
      loop: true,
    });
};
